    "1996-lead-shot-study-of-upland-habitat-on-north-dakotas-federal-trust-resource-land",nt"isopen":
    false,nt"url": null,nt"notes": "In 1996 the U.S. Fish and Wildlife Service
    (Service) collected field data to determine the extent of lead shot deposition on
    upland areas of North Dakotau2019s Federal trust resource lands. An electronic metal
    detector was used to sample 21 tracts of land totaling 6.415 hectares (ha) in 11
    Wetland Management Districts. This study was designed to identify upland areas where
    lead shot deposition might potentially affect bird morbidity and mortality. No lead
    shot pellets were found in any of the study areas. One steel shot pellet was found
    in the Lake Alice National Wildlife Refuge tract.",nt"license_title": "License
